import React from "react";
import { Routes, Route } from "react-router-dom";

// Patient & shared pages
import Home from "./pages/home_page_ui";
import Login from "./pages/login_page";
import Register from "./pages/register_page";
import Dashboard from "./pages/dashboard_page";
import Records from "./pages/records_page";
import Upload from "./pages/upload_page";
import AIChat from "./pages/aichat_page";
import Emergency from "./pages/emergency_page";
import Terms from "./pages/terms_page";
import ProtectedRoute from "./components/ProtectedRoute";

// Doctor‐side pages
import DoctorLogin from "./pages/doctor/Login";
import LocationSelection from "./pages/doctor/LocationSelection";
import PatientAccess from "./pages/doctor/PatientAccess";
import DoctorDashboard from "./pages/doctor/Dashboard";
import NewRecord from "./pages/doctor/NewRecord";
import ViewRecord from "./pages/doctor/ViewRecord";
import AccessHistory from "./pages/doctor/AccessHistory";

function App() {
  return (
    <Routes>
      {/* Public / Patient Routes */}
      <Route path="/" element={<Home />} />
      <Route path="/login" element={<Login />} />
      <Route path="/register" element={<Register />} />
      <Route path="/terms" element={<Terms />} />

      {/* Protected Patient Flows */}
      <Route
        path="/dashboard"
        element={<ProtectedRoute><Dashboard /></ProtectedRoute>}
      />
      <Route
        path="/records"
        element={<ProtectedRoute><Records /></ProtectedRoute>}
      />
      <Route
        path="/upload"
        element={<ProtectedRoute role="doctor"><Upload /></ProtectedRoute>}
      />
      <Route
        path="/ai-chat"
        element={<ProtectedRoute><AIChat /></ProtectedRoute>}
      />
      <Route
        path="/emergency"
        element={<ProtectedRoute><Emergency /></ProtectedRoute>}
      />

      {/* Doctor Module */}
      <Route path="/doctor/login" element={<DoctorLogin />} />
      <Route path="/doctor/location" element={<LocationSelection />} />
      <Route path="/doctor/access" element={<PatientAccess />} />
      <Route path="/doctor/dashboard" element={<DoctorDashboard />} />
      <Route path="/doctor/records/new" element={<NewRecord />} />
      <Route
        path="/doctor/records/:recordId"
        element={<ViewRecord />}
      />
      <Route path="/doctor/history" element={<AccessHistory />} />
    </Routes>
  );
}

export default App;
